import React, { Component} from 'react'
// import sprite from '/icons.svg'
// import Icon from './Icon'
// import { FaReact } from 'react-icons/fa';
// import ReactCardFlip from 'react-card-flip';
// import React, { useState } from 'react'
import { TiBeer } from "react-icons/ti";
import { IoMdIceCream } from "react-icons/io";
import { GoCalendar } from "react-icons/go";
import { FiMapPin } from "react-icons/fi";
import { RiCake2Line } from "react-icons/ri";
import { MdLocalDrink } from "react-icons/md";
 function InputDownbar() 
     {
      //   const [isFlipped,setisFlipped]=useState(false)

      //   const handleClick=()=>{
      //    setisFlipped(!isFlipped)
        
        return (
            <div>
                  
                  {/* <ReactCardFlip isFlipped={isFlipped} flipDirection="vertical"> */}
                               <h5 className='text-center mt-4 bts'>Browse Places</h5>
                               <div className='container-fluid mt-3 cont'>
                                       <div className='container '>
                                            <div className='row'>
                                           
                                                   <div className='col-md-2'>
                                                      {/* <span><i class='fas fa-glass-martini-alt mt-5 icon'></i> </span> */}
                                                      {/* <svg class="icon">
                                                               <use xlinkHref="/sprite.svg#open-day-calendar-page"/>
                                                       </svg>  */}
                                                      {/* <span class="flaticon-beer-mug"></span> */}
                                                      {/* <FaReact color='purple' size='5rem'/> */}
                                                      
                                                         <TiBeer  size='3rem'  fontWeight='lighter' className='reacticon' />
                                                        
                                                     
                                                     
                                                      
                                                      <p className='des text-center'>Drinks</p>
                                                   </div>
                                                   <div className='col-md-2'>
                                                        {/* <span className='mt-3'><i class='fas fa-calendar-check icon icons '></i></span> */}
                                                        <IoMdIceCream size='3rem'  fontWeight='lighter' className='reacticon'/>
                                                        <p className='des text-center'>Deserts</p>
                                                   </div>
                                                    {/* <p className=''>Drinks n NightKise</p> */}
                                                    <div className='col-md-2'>
                                                      {/* <span><i class="fa fa-birthday-cake icon icons"></i> </span> */}
                                                      <GoCalendar size='3rem'  fontWeight='lighter' className='reacticon'/>
                                                      <p className='des text-center'>Upcoming Events</p>
                                                   </div>
                                                   <div className='col-md-2'>
                                                      {/* <span><i class='fas fa-motorcycle icon icons'></i>  </span> */}
                                                      <FiMapPin size='3rem'  fontWeight='lighter' className='reacticon'/>
                                                      <p className='des text-center'>Near By</p>
                                                   </div>
                                                   <div className='col-md-2'>
                                                      {/* <span><i class='fas fa-glass-martini-alt  icon icons'></i> </span> */}
                                                      <RiCake2Line size='3rem'  fontWeight='lighter' className='reacticon'/>
                                                      <p className='des text-center'>Desserts & Bakes</p>
                                                   </div>
                                                   <div className='col-md-2'>
                                                      {/* <span><i class='fas fa-glass-martini-alt  icon icons'></i> </span> */}
                                                      <MdLocalDrink size='3rem'  fontWeight='lighter' className='reacticon'/>
                                                      <p className='des text-center'>Cafes & More</p>
                                                   </div>
                                                  
                                            </div>
                                            
                                       </div>
                               </div>
                               {/* </ReactCardFlip> */}
                  </div>
            
        )
    
                                                      }
   
export default InputDownbar;
